window.bookSummaryJSON = "<p>Two Iron Druid short stories available in audio for the first time, narrated by Luke Daniels!&nbsp;</p> <p>\"Kaibab Unbound\" occurs just a couple of weeks before the events of <i>Hounded</i>, book one of the series. Before Atticus gets drawn into the battles of gods and monsters, he has to protect one of the earth's elementals from an accomplished coven that wants to steal its power for their own.&nbsp;</p> <p>The events of \"A Test of Mettle\" happen concurrently with book three of the series, <i>Hammered</i>, as Granuaile MacTiernan and Oberon discover that Atticus doesn't have the final say over who can become a Druid's apprentice.&nbsp;</p> <p>These stories serve both as an introduction to the <i>New York Times</i> best-selling series and as exciting background for longtime fans.&nbsp;</p>"; 
